class LinearModel{constructor(){this.isFit=!1}}class LinearRegression extends LinearModel{constructor(){super(),this.m=0,this.b=0}fit(t,s){for(var i=0,h=0,e=0,r=0,a=0;a<t.length;a++)i+=t[a],h+=s[a],e+=t[a]*s[a],r+=t[a]*t[a];this.m=(t.length*e-i*h)/(t.length*r-Math.pow(Math.abs(i),2)),this.b=(h*r-i*e)/(t.length*r-Math.pow(Math.abs(i),2)),this.isFit=!0}predict(t){var s=[];if(this.isFit)for(var i=0;i<t.length;i++)s.push(this.m*t[i]+this.b);return s}}